(2, 'Education News', '&lt;p&gt;Testing&lt;/p&gt;', 1, 4, '0', NULL, '2021-05-03 23:19:19'),
(3, 'မနက်စာ မစားတာများလာရင်ခန္ဓာကိုယ်မှာဘာတွေပြောင်းလဲလာနိုင်လဲ', '&lt;p&gt;မနက်စာဆိုတာက လူတစ်ယောက်မှာလိုအပ်တဲ့ Energy ကိုဖြည့်ပေးနိုင်တဲ့အကောင်းဆုံးအစားစားအချိန်ပဲဖြစ်ပါတယ်။ လူတော်တော်များများက မနက်စာကိုဖယ်ရှောင်ပြီးနေ့လည်စာနဲ့ပေါင်းစားတတ်ကြပါတယ်။ ဒီလိုမျိုးပြုလုပ်ခြင်းက တစ်ရက်တစ်လေဆိုကိစ္စမရှိပေမဲ့ ရက်တာရှည်လာရင်တော့ ခန္ဓာကိုယ်အတွက် ဒီအချက်လေးတွေဖြစ်ပေါ်လာနိုင်ပါတယ်နော်။&lt;br style=&quot;box-sizing: inherit;&quot;&gt;ပင်ပန်းလာမယ်&lt;br style=&quot;box-sizing: inherit;&quot;&gt;ပင်ပန်းလွယ်လာရခြင်းက ခန္ဓာကိုယ်မှာရှိတဲ့ Glucose ဓာတ်တွေကကုန်ခန်းလာပြီး ပင်ပန်းနွမ်းနယ်မြန်ခြင်း၊ ထိုင်းမှိုင်းလွယ်ခြင်းတွေဖြစ်ပေါ်လာပါတယ်။ မနက်စားကို Heavy ကြီးမစားဖြစ်ရင်တောင် အနည်းဆုံးအသီးတစ်မျိုးမျိုးစားပေးသင်ပါတယ်။&lt;br&gt;&lt;/p&gt;', 1, 4, '0', NULL, '2021-04-28 23:20:02'),
(4, 'အိန္ဒိယနိုင်ငံရဲ့ယဉ်ကျေးမှုအမွေအနှစ်တွေနဲ့ အလေ့အထတွေက', '&lt;p style=&quot;box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; min-width: 100%;&quot;&gt;မတူကွဲပြားမှုတွေထဲကမှ စည်းလုံးညီညွတ်မှုကိုအဓိကဖော်ဆောင်တဲ့ India နိုင်ငံရဲ့ယဉ်ကျေးမှုဓလေ့ထုံးစံလေးတွေကိုပြောပြပေးချင်ပါတယ်။&lt;br style=&quot;box-sizing: inherit;&quot;&gt;အိန္ဒိယလူမျိုးတွေက ရှေးအရမ်းကျတဲ့လူမျိုးနွယ်စုလို့လည်းဖြစ်သလို အိန္ဒိယမှာရှိတဲ့ Indus &amp;nbsp;ချိုင့်ဝှမ်းကလည်းကမ္ဘာပေါ်မှာပထမဆုံးလူဦးရေးထွန်းကားခဲ့တဲ့ဒေသလည်းဖြစ်ပါတယ်။&lt;br style=&quot;box-sizing: inherit;&quot;&gt;အိန္ဒိယနိုင်ငံကိုတော့ အပိုင်းလေးပိုင်းခွဲခြားထားပြီးတော့ မြို့ပြကြီးတွေအလိုက်မတူညီတဲ့ယဉ်ကျေးမှုတွေရှိနေခဲ့ပါတယ်။ New Dehli ကတော့မြောက်အိန္ဒိယရဲ့အဓိကမြို့တော် ၊ အရှေ့အိန္ဒိယမှာတော့ &amp;nbsp;Kolkata ၊ အနောက်ဘက်မှာက Mumbai ၊ တောင်အိန္ဒိယရဲ့မြို့တော်က Chennai ပဲဖြစ်ပါတယ်။&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', 2, 1, '0', NULL, '2021-05-01 23:40:28'),
(5, '8 Unique and Secret tricks Front-end Developers don&#039;t know', '&lt;p&gt;This function allows you to perform calculations when specifying CSS property values. The most useful ability of&amp;nbsp;&lt;span style=&quot;border-style: solid; border-color: rgb(229, 231, 235); --tw-shadow:0 0 #0000; --tw-ring-inset: var(--tw-empty, ); --tw-ring-offset-width:0; --tw-ring-offset-color:#fff; --tw-ring-color:rgba(59,130,246,0.5); --tw-ring-offset-shadow:0 0 #0000; --tw-ring-shadow:0 0 #0000; border-radius: 0.25rem; padding: 0.25rem; --tw-text-opacity:1; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; --tw-bg-opacity:1;&quot;&gt;calc()&lt;/span&gt;&amp;nbsp;is that it mixed units, like percentages and pixels.&lt;br&gt;&lt;/p&gt;', 1, 5, '0', NULL, '2021-05-01 23:43:12');
