(14, 'အိန္ဒိယနိုင်ငံရဲ့ယဉ်ကျေးမှုအမွေအနှစ်တွေနဲ့ အလေ့အထတွေက', '&lt;p style=&quot;box-sizing: inherit; margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; min-width: 100%;&quot;&gt;မတူကွဲပြားမှုတွေထဲကမှ စည်းလုံးညီညွတ်မှုကိုအဓိကဖော်ဆောင်တဲ့ India နိုင်ငံရဲ့ယဉ်ကျေးမှုဓလေ့ထုံးစံလေးတွေကိုပြောပြပေးချင်ပါတယ်။&lt;br style=&quot;box-sizing: inherit;&quot;&gt;အိန္ဒိယလူမျိုးတွေက ရှေးအရမ်းကျတဲ့လူမျိုးနွယ်စုလို့လည်းဖြစ်သလို အိန္ဒိယမှာရှိတဲ့ Indus &amp;nbsp;ချိုင့်ဝှမ်းကလည်းကမ္ဘာပေါ်မှာပထမဆုံးလူဦးရေးထွန်းကားခဲ့တဲ့ဒေသလည်းဖြစ်ပါတယ်။&lt;br style=&quot;box-sizing: inherit;&quot;&gt;အိန္ဒိယနိုင်ငံကိုတော့ အပိုင်းလေးပိုင်းခွဲခြားထားပြီးတော့ မြို့ပြကြီးတွေအလိုက်မတူညီတဲ့ယဉ်ကျေးမှုတွေရှိနေခဲ့ပါတယ်။ New Dehli ကတော့မြောက်အိန္ဒိယရဲ့အဓိကမြို့တော် ၊ အရှေ့အိန္ဒိယမှာတော့ &amp;nbsp;Kolkata ၊ အနောက်ဘက်မှာက Mumbai ၊ တောင်အိန္ဒိယရဲ့မြို့တော်က Chennai ပဲဖြစ်ပါတယ်။&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', 2, 1, '0', NULL, '2021-05-01 23:40:28'),
